import React from 'react'

function HouseRenovationIdeas() {
  return (
    <div background-color="black" >
      <div>
        <img src="https://3ejgjd41qtccawse34f6koz1-wpengine.netdna-ssl.com/wp-content/uploads/2015/07/Zoller_e.jpg" alt="House Remodel Tip"></img>
        <h3 color="#feb13b">Upgrade the Front Door Area</h3>
        <p color="#e9e9e9">“Don’t underestimate the power of a front door. People make up their minds in the first seven seconds of entering a house,” says ERA broker Kristin Willens. The front door is the primary and ultimate transition space of your home. It’s also a critical part of any visitor’s first impression. Spruce up this exterior entry by painting your front door, upgrading your house numbers, replacing your front porch light fixture, tossing down a new door mat, or simply conducting a thorough overall cleaning of the front of your home. Why? Because “a welcoming entrance will definitely increase your home’s bottom line” – Diynetwork.</p>
      </div>
    </div>
  )
}

export default HouseRenovationIdeas
